User.create!([

  {username: "Guest", password_digest: "$2a$10$UmzORWL0QYzf97QPhU563uJadEgjsDSk1Hvtzn0edtzhsDEXFkIWG", session_token: "W_mL3xGDUL4Vevg0cxNZSw",

    bio: "I enjoy the simple things in life. Being happy is a state of mind, and I don't think cats should settle for less than they deserve. I always look toward the next best thing. I like seeing other cats happy. When a cat else is down, it breaks my heart. I've been through more than most cats my age, but hey, it's what has made me stronger. Life has thrown me challenges, and so far, I've come out on top. I realized who my real friends are, and that my family always comes first..always. Photography is a passion of mine. I love music and movies. Heroes and Chuck are my favorite TV shows, so that means Monday nights I'm unavailable! I'm average, and that's okay. I'm not one of those shallow cats that you turn your head toward when I walk down the street, and that's okay too. There is more to life than beauty on the outside. It's about what's on the inside. That's what really counts.", sex: "â™‚", residence: "Desolate Swamp", occupation: "Millionaire", age_preference: "The 20 somethings", interest_fact: ""},

