    bio: "I can make a great pet for the right owner and family. The most important thing is that I get lots of exercise, attention, and stimulation. Without this I may go a bit crazy and start acting up and chewing up the house. I also may be a bit too nerdy even for small children. People and other pets needs to remember that I am highly intelligent and bred to read books all day. So I should be treated accordingly. ", sex: "â™‚", residence: "Parched Woodland", occupation: "Being a Genius", age_preference: "The 30s workhorses", interest_fact: ""},

