    bio: "I have a 'squashed face,' but that's okay since people loves me anyways. The Bundesens say that my face appears grumpy because I have a form of dwarfism. Me and my brother Pokey were born to normal parents with 'a flat face, bubble eyes, and a short tail'. I am undersized and has hind legs that 'are a bit different'. Although we have a grumpy expression on her face and is called 'Grumpy Cat', according to the Bundesens, I am a normal cat '99% of the time'.", sex: "â™‚", residence: "Desolate Swamp", occupation: "Bringing people happiness", age_preference: "The never too late to huddle crowd", interest_fact: ""},

