    bio: "I have qualities other than the whimsical ears to make me a attractive pet. I am a people cat that do not show any of the stereotypical aloofness, and I am very affectionate without harassing people for attention the way some other cats would. I enjoy the delight in perching on shoulders and love to pat and nuzzle my peoples' faces. I am a 'fetching' cat, and never lose my love of play. Although I rather hang out with other cats and dogs instead of pesky children.", sex: "â™€", residence: "Windy Valley", occupation: "Professional Ballfetcher", age_preference: "The 20 somethings", interest_fact: ""},

