Group.create!([

{name: "Park Enthusiasts",

  body: "Bring yarnballs, frisbys, and your humans to the playground. Remember to share your possessions with other pets, even your yarnballs and humans! Please do not litter in the park, and bring doggy bags to pick up after yourself.", author_id: 1},

{name: "The Serious Pets",

  body: "", author_id: 2},

{name: "Road tripsters",

  body: "This group was created to organize day trips, weekend trips, full week trips, roadtrips and everything that has to do with traveling around Mexico mainly. A fun day to make some new friends while discovering the beauty of Mexico, its culture and much more. Lets go on road trips", author_id: 3},

