{name: "Nerds United",

  body: "We aim to get together 2-4 times a month. I, your Benevolent Nerdy Dictator, will take the lead on scheduling our nerd-outs, but feel free to suggest activities! Submit them through the Suggest a Meet-Up feature and I'll make sure they have all the needed information and then announce them to the group. (Alternatively, if you have an idea but don't want to host, please message me.)", author_id: 4},

{name: "Bath Fanatics",

  body: "'If we accept that sound is vibration and we know that vibration touches every part of our physical being, then we understand that sound is heard not only through our ears but through every cell in our bodies.' We are the bath lovers group.", author_id: 4},

{name: "Beach Go'ers",

  body: "If you love to just chill on the beach with your friends, or if your a novice or an experienced boarder looking for a cool way to meet new people and have a great time then this club is for you.  We offer a summer, & fall season club membership which includes regularly scheduled events to Rockaway Beach, and when the swells arrive we'll be posting events at Gilgo Beach and Ditch Plains! Later in the fall we'll be announcing some overnight trips to camp out and go surfing in Montauk right on the beach!  ", author_id: 4},

{name: "Happy Campers",

  body: "If you like to camp, build bonfires, grill out and chill out with a highly entertaining group of campers, you have found the right meetup group.  We are the largest and oldest camping club and outdoor adventure group in Arizona.  Join our group and we will take you to spots and panoramic views that are not listed in any camping guide or vacation travel guide. Our bonfires are bigger, the company is better, and our crowd is friendlier and more easy going than any group in Catsville", author_id: 2},

{name: "Sushi Lovers",

  body: "At our core is our  passion for Sushi, and yes, there are some who are horrified at the thought of eating raw fish, but please know that a lot of sushi is NOT raw -- and, that there are always many other items besides sushi on the menu. But our palette is not limited to Sushi, with cat food being another favorite among our members.  So please join us for either or both! ", author_id: 2},

{name: "I Haz a Fancy Car",

  body: "Cary Sports Cars Meetup is a group for pets in the area to get together and enjoy their cars. This includes weekend rides and events.", author_id: 2},

{name: "The Gardeners",

  body: "We usually meet on weekends in club members' gardens or local nurseries, discussing a different gardening topic each time, presented by an expert in that subject. The number who attend these events has ranged from ten to 81 members and visitors. We all learn about the particular problems of gardening in this sub-tropical environment, exchange our excess plants for free, share light foods and drinks during the snack-and-chat period, and trade gardening information and advice.", author_id: 2},

{name: "Adventurous Hikers",

  body: "While the most exciting events include trips to the Rockies and other destinations, we also try to keep in shape by hiking on a regular basis in the river valley and at recreational areas around the city. Regular events include weekly walks, hikes and and snowshoe trips, and overnight hiking and camping/hosteling trips in the mountains and around the province.

To participate, all you have to do is sign up, then come out and have fun. Remember to post a photo - we want to encourage friendly participation, and besides, we like to know who we're looking for at the trailhead.", author_id: 2},

{name: "Coffee Addicts",

  body: "the meetup for people that are passionate about coffee. The goal of the meetup is to be as highly-approachable and relaxed as possible and is completely open to peoplethat are new to, or simply curious about, the wealth of different flavors that can be derived from coffee. This isn't particularly aimed at bearded baristas, tattooed fixie bike riders or to people with San Franciscan, Melbourne or New York accents. That said, if you have one or all of these traits we won't hold that against you! The events will primarily involve coffee tastings (known as cuppings) with coffees from various cities being highlighted! First up we take a look at what Berlin has to offer, with coffees coming their top micro-roasteries including The Barn and Five Elephant! ", author_id: 2},

{name: "Weekend Bikers",

  body: "As an active group we enjoy regular, well planned rideouts to various destinations both locally and abroad with popular start/finish points such as Newlands Corner, Boxhill, Reigate Hill, West Wickham, Westerham, Pease Pottage and Hogs Back.

Group sizes are well managed and are limited to 12-15 riders per event which ensures a smooth, progressive and safe ride for all. Rideout distances vary from 80 to 250 miles per day depending on the destination and time of year. We also enjoy the odd weekend away and Euro trip in the summer months when time and rider numbers allow.", author_id: 2},

{name: "Movie Devotees",

  body: "Join our group to meet other local movie fans! Get together to plan movie outings and discuss hot movies of the month. We will go to local movie theaters to watch movies, and head to local restaurant, bars and coffee houses afterwards to meet, mingle and discuss. We are a fun and exciting group of people that love movies. We discuss the films we watch over drinks or a nice meal.  We love to meet and socialize with new and old friends.", author_id: 2},

{name: "Fish are Friends",

  body: "I am a nice cat, not a mindless eating machine. If I am to change this image, I must first change myself. Fish are friends, not food. Repeat! I am a nice cat, not a mindless eating machine. If I am to change this image, I must first change myself. Fish are friends, not food.", author_id: 2},

{name: "I Own Fancy Socks",

  body: "Fancy socks group features a huge selection of unique, awe-inspiring, and bizarre socks. But donâ€™t let our whimsical nature fool you, we take quality and comfort very seriously. All of our socks are made from high quality cotton blends, guaranteed to last numerous slides down the hallway, Tom Cruise style. These soft cotton blends also ensure a more comfortable fit and a sock that wonâ€™t shrink after a only a few washes.

Our socks come from all corners of the globe (yea, we realize globes donâ€™t have corners.), representing a unique perspective and design that is sure to please. Your subscription will feature bizarrely creative socks from Korea, funky unisex creations from Sweden, and sophisticated patterns and colors from the United States, to name a few. We genuinely love our socks and we know you will too. If you donâ€™t, send â€™em back and weâ€™ll get you a fresh pair.", author_id: 2},

{name: "The Geniuses",

  body: "A genius is a person who displays exceptionally superior intellectual ability, creativity, or originality, typically to a degree that is associated with the achievement of new advances in a domain of knowledge. A scholar in many subjects or a scholar in a single subject may be referred to as a genius. There is no scientifically precise definition of genius, and the question of whether the notion itself has any real meaning has long been a subject of debate, although psychologists are converging on a definition that emphasizes creativity and eminent achievement.", author_id: 2},

{name: "The Procrastinators",

  body: "I created this group because... I give up. I stay awake till 5:27 AM trying to finish some stupid History movie review, and i just end up wasting a good 8 hours browsing Urban Dictionary and talking to myself. From now on im gona accept that im incapable of doing homework and use my time on other things such as homework or msn, or URBAN DICTIONARY.
Thats procastination for ya.", author_id: 8} ])



