    {title: "Library day for Pets - Read up on JS", location: "bookstore library", date: "2015-08-06", body: "There are over 50,000 residents living in Pittsburgh's Northside neighborhoods and until now there have been no open Toastmasters clubs for these communities. That changes with the establishment of the Northside Toastmasters to serve the community and develop its current and future leaders. In our meetings, members present prepared speeches, receive written and oral evaluations, practice impromptu speaking, and share fellowship in a supportive, non-intimidating environment. These experiences develop our members into greater communicators while practicing essential leadership skills. ", author_id: 1, group_id: 1},

    {title: "Gaming Day", location: "office classroom", date: "2015-10-15", body: "Please bring a board and/or dictionary if you have one to share. We  will meet upstairs at Wegmans on Alberta Drive (behind the Boulevard Mall). I will get there about 6:00-6:15 to grab a bite to eat first. Consider joining us. ", author_id: 1, group_id: 1},

